import React from "react";
import { Chart, ArcElement, Tooltip, Legend, Title } from "chart.js";
import { Doughnut } from "react-chartjs-2";

// Register chart components
Chart.register(ArcElement, Tooltip, Legend, Title);

// Customize chart defaults
Chart.defaults.plugins.tooltip.backgroundColor = "rgb(0, 0, 156)";
Chart.defaults.plugins.legend.position = "right";
Chart.defaults.plugins.legend.title.display = true;
Chart.defaults.plugins.legend.title.text = "60 of 100 Done";
Chart.defaults.plugins.legend.title.font = { family: "Helvetica Neue", size: 14 }; // Properly set the font object

// Define chart data
const data = {
  labels: ["Processed", "Pending"],
  datasets: [
    {
      data: [60, 40],
      backgroundColor: ["rgb(0, 197, 0)", "rgb(204, 223, 243)"],
      borderWidth: 2,
      radius: "40%",
    },
  ],
};

// Component for rendering the donut chart
function DonutChart() {
  return (
    <div>
      <h2>Requests Summary Widget</h2>
      <Doughnut data={data} />
    </div>
  );
}

export default DonutChart;
